import React, { useState } from 'react'; 

const TaskItem = (props) => {

    return (
        <li>
            <input type="checkbox" onChange={taskCheckHandler} className="w-4 h-4 rounded-full focus:ring-1" />
            <div className="ml-3">
                <p className="text-base font-medium">{props.taskTitle}</p>
                <p className="text-xs text-gray-500">{props.taskDetails}</p>
             </div>
        </li>
    );
}
